import React from "react";
import { useLayoutEffect } from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

  export default function AdminDashboard ()
{
    state = {
        persons: []
      }

 useEffect(() => {


        var auth = JSON.parse(localStorage.getItem('auth'));
        axios.get("http://localhost:8080/api/mentorapplication",auth).then(
            response => {
             const persons = response.data;
            this.setState({persons})
    })
});
    return(
    <div className="AdminDashboard">
        <h1> admin </h1>
        <h2>mentor app : </h2>
        <ul>
           { this.state.persons.map(person => <li> {person.id.toString() + person.menteeid.toString() +  person.details} </li>)}
        </ul>
        <Router>
            <div>
                <nav>
                    <li>
                      <Link to="/AdminTopicPanel">AdminTopicPanel</Link>
                    </li>
                </nav>
            </div>
            <Route path="/adminTopicPanel">
<AdminTopicPanel />
</Route>
        </Router>

    </div>
    ) 
}
